import React, {useState} from 'react';

function Login() {

    const [loginInput, setLoginInput] = useState({
        username: "",
        password: ""
    })

    console.log(loginInput);

    return (
        <div>
            <h1>Login</h1>
            <p>Username</p>
            <input id='username' value={loginInput.username} onChange={(e) => setLoginInput({...loginInput, [e.target.id]: e.target.value})}/>
            <p>Password</p>
            <input id='password' value={loginInput.password} onChange={(e) => setLoginInput({...loginInput, password: e.target.value})}/>
        </div>
    );
}

export default Login;
